        temperature: undefined,
        waterLevel: undefined,
        moister: undefined
    };

    call_rest = () => {

    }

    render() {


        return (
            <div className="wrapper">
                <div className="element">
                    <div>Temperture</div>
                    <div>{this.state.temperature}</div>
                </div>

                <div className="element">
                    <div>Moister</div>
                    <div>{this.state.moister}</div>
                </div>

                <div className="element">
                    <div>Water Level</div>
                    <div>{this.state.level}</div>
                </div>

            </div>
        );
    }
}

export default GetDataPage;
